import React from 'react';
import RegistrationI from './RegistrationI';
import { BrowserRouter, Routes, } from "react-router-dom";
import Home from "./Home"

const App = () => {
  return (
    <>
    <Router>
      <Switch> 
          <Route exact path="/" component={Home} /> 
          <Redirect to="/" />
      </Switch>
    </Router>
    </>
  )
};

export default App;
